def gettreewithfossil(tree,formatt=False,wholetree=False,Yang=False,orderdata=None,Updated_Tree=False):
    with open(tree,'r') as f: lines = f.read()
    handle = StringIO(skipnontreeline(lines))
    Tree = Phylo.read(handle,"newick")
    treef = os.path.abspath(tree) + ".addtime"
    treeftax = os.path.abspath(tree) + ".addtime_taxonomy"
    taxonomy_dict = {}
    Focus_sp = None
    if orderdata is not None: sp_order = writedic(orderdata)
    for clade in Tree.get_terminals():
        if clade.name.endswith("_ap1"):
            clade.name = clade.name.replace("_ap1","")
            Focus_sp = clade.name
        if clade.name.endswith("_ap2"): clade.name = clade.name.replace("_ap2","")
        success = False
        while success == False:
            try:
                info = get_taxonomy(clade.name)
                success = True
            except HTTPError as e:
                success = False
        if info['order'] == '': info['order'] = clade.name # This step is tricky, assuming the input is already order name
        taxonomy_dict[clade.name] = info
        logging.info("{} belongs to {}".format(clade.name,taxonomy_dict[clade.name]['order']))
    for i,clade in enumerate(Tree.get_nonterminals()):
        order_occur = [taxonomy_dict[tip.name]['order'] for tip in clade.get_terminals()]
        if len(set(order_occur)) <=1: continue
        Mininum_limit,Maximum_limit,order_occur = 0,0,[]
        if wholetree:
            total_clades = getotalcaldes(clade,taxonomy_dict,Updated_Tree=Updated_Tree)
        else:
            total_clades = clade.get_terminals()
        for tip in total_clades:
            age = Orders_Bounds.get(taxonomy_dict[tip.name]['order'],0)/100 if not wholetree else Orders_Bounds.get(tip.name,0)/100
            if age > Mininum_limit: Mininum_limit = age
            if Yang:
                upper_age = Clades_Upper_Bounds_FollowYang.get(taxonomy_dict[tip.name]['order'],0)/100 if not wholetree else Clades_Upper_Bounds_FollowYang.get(tip.name,0)/100
            else:
                upper_age = Clades_Upper_Bounds.get(taxonomy_dict[tip.name]['order'],0)/100 if not wholetree else Clades_Upper_Bounds.get(tip.name,0)/100
            if upper_age > Maximum_limit: Maximum_limit = upper_age
        clade.name = '[>{0:.4f}<{1:.4f}]'.format(Mininum_limit,Maximum_limit)
    Phylo.write(Tree,treef, "newick")
    postprocesstree(treef)
    for clade in Tree.get_terminals(): clade.name = taxonomy_dict[clade.name]['order']
    Phylo.write(Tree,treeftax, "newick")
    postprocesstree(treeftax)
    if formatt:
        formatmcmctree(len(Tree.get_terminals()),treef)
        formatmcmctree(len(Tree.get_terminals()),treeftax)
    if Focus_sp !=None:
        formatfocussp(treef,Focus_sp)
        formatfocussp(treeftax,Focus_sp)
    return treef

def formatfocussp(fname,Focus_sp):
    with open(fname,"r") as f: content = f.read()
    with open(fname,"w") as f: f.write(content.replace(Focus_sp+",",Focus_sp+"_ap1,").replace(Focus_sp+")",Focus_sp+"_ap2)"))

def formatmcmctree(spnum,fname):
    with open(fname,"r") as f: content = f.read()
    with open(fname,"w") as f:
        f.write("{} 1\n{}".format(spnum,content))

def getotalcaldes(clade,taxonomy_dict,Updated_Tree=False):
    handle = StringIO(Updated_Tree_in_Paper) if Updated_Tree else StringIO(APG_IV_Modified_Tree)
    Tree = Phylo.read(handle,"newick")
    orrurred_clades = [taxonomy_dict[tip.name]['order'] for tip in clade.get_terminals()]
    MRCA_Node = Tree.common_ancestor(*orrurred_clades)
    return MRCA_Node.get_terminals()

def findneighbor(belonged_order,number=8):
    # The number here is the number of orders
    handle = StringIO(APG_IV_Modified_Tree)
    Tree = Phylo.read(handle,"newick")
    All_Clades = [i.name for i in Tree.get_terminals()]
    needed_mrca = None
    for mrca in map(lambda x:Tree.common_ancestor(x,belonged_order),All_Clades):
        if len(mrca.get_terminals()) == number:
             needed_mrca = mrca
             break
    return needed_mrca

def replacespecies(content,Clade_names,inname,onlyone=False):
    original_sp_num = int(content.split('\n')[0].split(' ')[0])
    for i in Clade_names:
        if i.endswith("_ap1") or i.endswith("_ap2"): continue
        #added_num = len(Orders_replace_Species[i].split(',')) - 1
        #final_sp_num = original_sp_num + added_num
        if onlyone:
            content = content.replace(i,Orders_replace_One_Species[i])
            logging.info("Representative species of {0}: {1}".format(i,Orders_replace_One_Species[i]))
        else:
            content = content.replace(i,Orders_replace_Species[i])
            logging.info("Representative species of {0}: {1}".format(i,Orders_replace_Species[i].replace('()','')))
    handle = StringIO(content.split("\n")[1])
    Tree = Phylo.read(handle,"newick")
    spnum = len(Tree.get_terminals())
    with open("{}_sp{}_species_list_space".format(inname,spnum),"w") as f:
        focussp = ''
        for i in Tree.get_terminals():
            if i.name.endswith("_ap2") or i.name.endswith("_ap1"):
                focussp = i.name[:-4]
                continue
            f.write("{} ".format(i.name))
        f.write("{}".format(focussp))
    with open("{}_sp{}_species_list_lines".format(inname,spnum),"w") as f:
        focussp = ''
        for i in Tree.get_terminals():
            if i.name.endswith("_ap2") or i.name.endswith("_ap1"):
                focussp = i.name[:-4]
                continue
            f.write("{}\n".format(i.name))
        f.write("{}".format(focussp))
    content = content.replace(str(original_sp_num)+" ",str(spnum)+" ")
    return content, spnum

def getproperstartingtree(treef,number,outdir,onlyone=False):
    # Only works for order-level/or more recent WGDs
    Tree = Phylo.read(treef,"newick")
    Clade_names = [i.name for i in Tree.get_terminals()]
    with open(treef,"r") as f: content = f.read()
    content, spnum = replacespecies(content,Clade_names,os.path.basename(treef),onlyone=onlyone)
    with open(treef+'_{}sp'.format(spnum),"w") as f: f.write(content)

